import Layout from '../components/MyLayout.js'
import Link from 'next/link';
import Header from "../components/Header.js";

function getPosts() {
  return [
    { id: 'hello-nextjs', title: 'Hello Next.js' },
    { id: 'learn-nextjs', title: 'Learn Next.js is awesome' },
    { id: 'deploy-nextjs', title: 'Deploy apps with ZEIT' }
  ]
}

function PostLink({ post }) {
  return (
    <li>
      <Link as={`/p/${post.id}`} href={`/post?title=${post.title}`}>
        <a>{post.title}</a>
      </Link>
      <style jsx>{`
        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
          font-family: 'Arial';
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </li>
  )
}

export default function Index() {
  return (
    <div >
    <link href="/static/index.css" type="text/css" rel="stylesheet"/>
    <Header/>
    <div className="homeImg">
        <div className="homeDiv center">
          <h1>My Blog</h1>
          <h3>an electronics hobbyist passionate for innovative technology and digital content</h3>
        </div>

    </div>
    <div className="aboutMe">
      <p class="pad20"> Welcome to My Website Im a super talented
      extremely masterful god of technology and creator of the universe</p>
    </div>
    <style jsx>{`
      .aboutMe {
      color : black;
      }
    `}</style>
    </div>
  )
}
